import React from 'react';
import './SingleRecipe.css';

//destructuring of components

export default function SingleRecipe(props) {
	console.log(props);

	return (
		<div className='recipesCard'>
			<div>
				{' '}
				<h1 className='titleRecipe'>{props.title}</h1>
				<h1 className='summaryRecipe'>{props.summary}</h1>
				<div>
					<h1 className='healthScoreRecipe'>{props.healthScore}</h1>
				</div>
				<div>
					<h4 className='dietsRecipe'>{props.diets}</h4>
				</div>
				<div>
					<h1 className='typeDiet'>
						{props.Diets === undefined
							? false
							: props.Diets?.map((o) => o.name)}
					</h1>
				</div>
				<div>
					<h2 className='instructionsRecipe'>{props.instructions}</h2>
				</div>
				<div>
					<img
						className='imageRecipe'
						src={props.image}
						alt='Imagen no disponible'
					/>
				</div>
			</div>
		</div>
	);
}
